    'longtitle' => 'Вид, характеристики и стоимость вибропрессованных изделий Завода LATERES',
    'description' => 'Завод LATERES - широкий ассортимент строительных блоков, тротуарной плитки, бордюрного камня, а также облицовочного кирпича различных модификаций и размеров',
